@import '../base/base';
@import '../base/fonts';
@import '../base/typography';
@import '../utils/maps';
@import '../utils/variables';
@import '../utils/mixin';
@import '../utils/keyframes';
@import '../components/loader';
@import '../components/card_restaurant';
@import '../components/cardMenu';
@import '../components/greenLign';
@import '../components/buttons';
@import '../components/icones';
@import '../components/circle';
//@import '../layout/restaurantMenu';
@import '../layout/footer';
@import '../pages/index';
@import '../vendors/normalize';
header{
    position: relative;
    a{
        position: absolute;
        left: 10px;
    }
}
.image img{
    @include img_size;
    border-radius: 0px;
    height: 300px;
}
.main2{
    margin-top: -60px;
    padding: 20px 0px;
    background-color: $colour-gray;
    border-radius: 50px 50px 0 0 ;
    position: relative;
    .restaurant_name{
        font-size: 62%;
        h1{
            width: 300px;
            margin: auto;
        }
        .heart .fas{
            top: 35px;
            right: 30px;
        }
        }
    } 
    .menu{
        width: 100%;
        @include dish;
        .entrees .course{
            animation : loading_menus 3s;
            animation-fill-mode: forwards;
        }
        .plats .course{
            animation : loading_menus 6s;
            animation-fill-mode: forwards;
        }
        .desserts .course{
            animation : loading_menus 9s;
            animation-fill-mode: forwards;
        }
        @include media_tablet {
            margin: 0%;
                display: flex;

                flex-flow: row wrap;
                justify-content: center;

                .dish{
                width: 300px;
                }
            }

        }


    a.commander{
        width: 300px;
        margin: 50px auto;
    }
